edgemart Transformation

The edgemart Transformation gives the dataflow access to an existing, registered dataset. Use this transformation to reference a dataset so that its data can be used in subsequent transformations in the dataflow.

To pull data from an existing dataset in a Data Prep recipe, see Create a Recipe with Data Prep.
To do it in a Data Prep Classic recipe, see Create a Recipe with Data Prep Classic.

EXAMPLE

Letâ€™s look at an example. You would like to compare the final sales amount against the opportunity amount to determine if heavy discounts were offered to close deals. You previously created and registered the FinalSales dataset.

You create the following dataflow definition.
{
    "Extract_Opportunities": {
        "action": "sfdcDigest",
        "parameters": {
            "object": "Opportunity",
            "fields": [
                { "name": "Id" },
                { "name": "Name" },
                { "name": "Amount" }
            ]
        }
    },
    "Extract_Final_Sales_Data": {
        "action": "edgemart",
        "parameters": { "alias": "FinalSales" }
    },
    "Combine_Opportunities_FinalSales": {
        "action": "augment",
        "parameters": {
            "left": "Extract_Opportunities",
            "left_key": [ "Id" ],
            "relationship": "Opportunity",
            "right": "Extract_Final_Sales_Data",
            "right_key": [ "OppID" ],
            "right_select": [ "SaleAmount" ]
        }
    },
    "Register_Opportunity_FinalSales_Dataset": {
        "action": "sfdcRegister",
        "parameters": {
            "alias": "OpportunityVersusFinalSales",
            "name": "OpporunityVersusFinalSales",
            "source": "Combine_Opportunities_FinalSales"
        }
    }
}

edgemart Parameters

When you define an edgemart transformation, you set the action attribute to edgemart and specify the parameters.
